const name = "not-editable";
const pathData = "M87.5 397l41 41 130-130-41-41zm-30-363l434 434c5 5 7 12 7 18 0 16-11 26-26 26-6 0-13-2-18-7l-160-161-148 148c-5 5-11 7-18 7h-77c-14 0-25-11-25-25v-77c0-7 2-13 7-18l148-148-161-160c-5-5-7-12-7-18 0-16 11-26 26-26 6 0 13 2 18 7zm367 108l-41-41-40 41 40 40zm-117 36l-10 9c-5 5-11 8-18 8-14 0-25-12-25-26 0-7 2-13 7-18l104-104c5-5 12-7 18-7 7 0 13 2 18 7l77 77c5 5 7 11 7 18 0 6-2 13-7 18l-104 104c-5 5-11 7-18 7-14 0-26-11-26-25 0-7 3-13 8-18l9-10z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
